import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";
export default function Home() {

  let { address } = useParams();
  let number = parseFloat(address.split('-')[0])
  let tld = address.split('-')[1] + '-' + address.split('-')[2] 

  return(
    <div>
   <h2>{address}</h2>
   <div>
   Neighbours: <br />
   <br />
            <Link to="/{number+2}-{tld}">{number+2}-{tld}</Link>
        <br />
            <Link to="/{number-2}-{tld}">{number-2}-{tld}</Link>

        </div>
        </div>
   )
}
